import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import AuthHandler from "./components/Contexts/AuthHandler";
import Dashboard from "./components/Dashboard/Dashboard";
// import Tracks from "./components/Tracks/Tracks";
// import Artists from "./components/Artists/Artists"; 
// import Genres from "./components/Genres/Genres";
// import Recent from "./components/RecentlyPlayed/RecentlyPlayed";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<AuthHandler />} />
        <Route path="/dashboard" element={<Dashboard />}>
          {/* <Route path="tracks/top" element={<Tracks />} />
          <Route path="artists/top" element={<Artists />} />
          <Route path="genres/top" element={<Genres />} />
          <Route path="recent" element={<Recent />} /> */}
        </Route>
        <Route path="/" element={<Navigate to="/login" />} />
        <Route path="*" element={<Navigate to="/dashboard" />} />
      </Routes>
    </Router>
  );
}

export default App;
